import React from 'react';

const Header = () => {
    return(
        <>
             <header class="font-[DunkinSans] h-[clamp(60px,6.284vw,92px)] sticky top-0 text-espresso md:px-[10px] z-[60] bg-[url(&#x27;/resources/images/common/header_bg.png&#x27;)] bg-bottom lg:shadow-[0_0_20px_0_rgba(29,7,0,0.3)]">
                    <div class="w-full max-w-[1464px] mx-auto h-full relative flex justify-between items-center"></div>
            </header>
            <p>header</p>
        </>
    )
}

export default Header
